import React from "react";
import { Bar } from 'react-chartjs-2';
const axios = require('axios');

//const level_list = [12, 19, 3, 5, 2, 3];

axios.get('http://localhost:5000/by_company/Mercado Libre/Software Engineer')
  .then(res => {

    var level_list = [];
    for (const [key, value] of Object.entries(res.data.salary_by_level)) {
      level_list.push(value)
    }

    const BarChart = () => {
      return (
        <div>
          <Bar
            data={{
              labels: ['L0', 'L1', 'L2', 'L3', 'L4', 'L5'],
              datasets: [
                {
                  label: 'SALARY VS LEVEL',
                  data: level_list,
                  backgroundColor: [
                    'rgba(255, 99, 132, 0.2)',
                    'rgba(54, 162, 235, 0.2)',
                    'rgba(255, 206, 86, 0.2)',
                    'rgba(75, 192, 192, 0.2)',
                    'rgba(153, 102, 255, 0.2)',
                    'rgba(255, 159, 64, 0.2)'
                  ],
                  borderColor: [
                    'rgba(255, 99, 132, 1)',
                    'rgba(54, 162, 235, 1)',
                    'rgba(255, 206, 86, 1)',
                    'rgba(75, 192, 192, 1)',
                    'rgba(153, 102, 255, 1)',
                    'rgba(255, 159, 64, 1)'
                  ],
                  borderWidth: 0.5,
                },
                // {
                //   label: 'Quantity',
                //   data: [47, 52, 67, 58, 9, 50],
                //   backgroundColor: 'orange',
                //   borderColor: 'red',
                // }
              ],
            }}
            height={400}
            width={600}
            options={{
              maintainAspectRatio: false,
              scales: {
                yAxes: [
                  {
                    ticks: {
                      beginAtZero: true,
                    }
                  }
                ]
              },
              plugins: {
                legend: {
                  labels: {
                    font: {
                      size: 14
                    }
                  }
                }
              }
            }}
          />
        </div>
      )
    }

  })
  .catch(err => {
    console.log('Error: ', err.message);
  });

  export default BarChart;
